import React from 'react'
import Header from '../frontend-js/header'
import Footer from '../frontend-js/footer'
import '../frontend-scss/projects.css'
import { Component } from 'react'

export default class projects extends Component {
    constructor(props){
        super(props);
        this.state={
            projectsList:[
                {
                    name: 'E-commerce',
                    stack: 'ReactJS, Redux, Bootstrap, MySQL, SCSS, NodeJS, ExpressJS',
                    duration: '3 months',
                    link: 'https://github.com/GoofyGalaxy374/ProjectManager'
                },
                {
                    name: 'Project Manager',
                    stack: 'ReactJS, Bootstrap, SCSS, JQuery, Redux,MYSQL',
                    duration: '1 week'
                },
                {
                    name: 'Foodr',
                    stack: 'ReactJS',
                    duration: '3 weeks'
                },
            ]
        }
    }
    render() {
        return (
            <div className='projectsWrapper'>
                <Header/>
                <div className='projectsList'>
                    {this.state.projectsList.map(project=>
                    <div className='projectWrapper'>
                        <p className='projectName'>Project Name: {project.name}</p>
                        <p className='projectStack'>Project Stack: {project.stack}</p>
                        <a href={project.link} className='projectLink'> <p>Project Link </p></a>

                        <p className='projectDuration'>Project Duration: ~{project.duration}</p>
                    </div>)}
                </div>
                <Footer/>

            </div>
        )
    }
}
